import React, { useState } from "react";

const Checkbox=({initialState, id, onChange})=>{
    const [check,setCheck]=useState();
    const onClick=(check)=>{
        setCheck(check);
        onChange(id,check);
    }
   return(
       <input type="checkbox" onClick={e=>onClick(e.target.check)} 
       check={check}/>

   )
}

export default Checkbox;
